import containerStyle from './stylesWrypperStore/WrapperModal.module.css'

const WrapperModal = ({children}) => {
    <div className = {containerStyle.modal}>
        <div className={containerStyle.modalContent}>
        {children}
        </div>
    </div>
}

export default WrapperModal;
